function ListGroup() {
  const items = ["Coffee", "Tea", "Hot Chocolate", "Lemonade", "Italian Soda"];

  return (
    <>
      <h1> My list of items </h1>
      <ul className="list-group">
        {items.map((item) => (
          <li className="list-group-item" key={item}>
            {item}
          </li>
        ))}
      </ul>
    </>
  );
}
export default ListGroup;
